import React from "react"

export default function Info() {
    return (
        <div className="info">
            <img className="photo" src={require("../images/fb-default.png")} width="317" height="317"/>

            <h3>Steve Kim</h3>
            <h4>Frontend Developer</h4>
            <p>https://github.com/swswkim</p>

            <button>Email</button>
            <button>LinkedIn</button>
        </div>
    )
}
